function MoviesCard({ movie }) {

  return (
    <article className="card color_background">
      <a
        href={'href'}
        target="_blank"
        rel="noopener noreferrer"
        className="card__trailer-link"
      >
        <img className="card__image" src='#' alt='Постер к фильму' />
        <button
          className={`card__favorite color_secondary link`}
        ></button>
      </a>
      <div className="card__header">
        <div><h3 className="card__title text_subtitle">Название фильма</h3></div>
        <div><p className="card__duration text color_text">{'1ч 57м'}</p></div>
      </div>
    </article>
  );
}

export default MoviesCard;
